import requests
import time
import json
from concurrent.futures import ThreadPoolExecutor, as_completed

# Define the URL of your endpoint
url = 'http://127.0.0.1:5001/process_image'

# Define the JSON request body
json_body = {
    "base64_image": ""
}

# Number of requests to make
num_requests = 10

# File to save the responses and timings
output_file = 'response_concurrency.txt'

def send_request(request_id):
    start_time = time.time()
    
    try:
        # Send POST request to the endpoint
        response = requests.post(url, json=json_body)
        end_time = time.time()
        
        # Calculate the time taken
        time_taken = end_time - start_time
        
        # Get the response content
        response_content = response.json()
        
        # Format response and timing data
        result = {
            'request_id': request_id,
            'start_time': start_time,
            'time_taken': time_taken,
            'response': response_content
        }
        
        return result
    
    except requests.RequestException as e:
        # Handle any request-related errors
        return {
            'request_id': request_id,
            'error': str(e)
        }

def main():
    with ThreadPoolExecutor(max_workers=num_requests) as executor:
        futures = [executor.submit(send_request, i + 1) for i in range(num_requests)]
        
        with open(output_file, 'w') as file:
            for future in as_completed(futures):
                result = future.result()
                if 'error' in result:
                    file.write(f"Request {result['request_id']} failed:\n")
                    file.write(f"Error: {result['error']}\n\n")
                    print(f"Request {result['request_id']} failed: {result['error']}")
                else:
                    file.write(f"Request {result['request_id']}:\n")
                    file.write(f"Start time: {result['start_time']:.4f} seconds\n")
                    file.write(f"Time taken: {result['time_taken']:.4f} seconds\n")
                    file.write(f"Response: {json.dumps(result['response'], indent=2)}\n\n")
                    print(f"Request {result['request_id']} completed in {result['time_taken']:.4f} seconds")
    
    print(f"Responses and times saved to {output_file}")

if __name__ == "__main__":
    main()